import React from 'react';
import Nav from 'react-bootstrap/Nav';
import {navStyle} from '../css/navigationStyle';
import { Button, NavbarBrand } from 'react-bootstrap/Button';

//import './css/navigationStyle.css';

class Navigation extends React.Component {

  render() {
    return (
      <div>
        <Navbar bg="dark">
          <Navbar.Brand href="#home">
            <img
              src="/logo.svg"
              width="30"
              height="30"
              className="d-inline-block align-top"
              alt="React Bootstrap logo"
            />
          </Navbar.Brand>
          <Nav.Item color={navStyle.color}>
            <Nav.Link href="/home">Financial Tools</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link eventKey="link-1">Wealth Management</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link eventKey="link-2">About</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link eventKey="link-2">Resources</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Button href="#">Login</Button>
          </Nav.Item>
          <Nav.Item>
            <Button href="#">Sign Up</Button>
          </Nav.Item>
        </Navbar>
        /*<Nav color={navStyle.backgroundColor} className="justify-content-end navStyle" activeKey="/home">

        </Nav>*/
      </div>
    )
  }
}

export default Navigation;
